	static public int LengthOfLongestSubstring(String s) {
		int result = 0;
		long begin = System.currentTimeMillis(); // 这段代码放在程序执行前
		if (s == null || s.isEmpty()) {
			return 0;
		}
		String str = "" + s.charAt(0);
		for (int i = 1; i < s.length(); i++) {
			boolean is = str.contains("" + s.charAt(i));
			if (is) {
				if (result < str.length()) {
					result = str.length();
				}
				// 超时，所以优化i
				// i = i + str.indexOf(""+s.charAt(j));
				while (str.contains("" + s.charAt(i))) {
					str = str.substring(1);
				}
			}
			str = str + s.charAt(i);
		}
		long end = System.currentTimeMillis() - begin; // 这段代码放在程序执行后
		System.out.println("耗时：" + end + "毫秒");
		if (result < str.length()) {
			result = str.length();
		}
		return result;
	}

